A struct is a composite datatype representing a named collection of variables. The contained variables can be of any type. The following code shows an example of how to use structs. struct Bar { field[2] c bool d
} struct Foo { Bar a bool b
} def main() -> (Foo): Foo[2] f = [Foo { a: Bar { c: [0, 0], d: false }, b: true}, Foo { a: Bar {c: [0, 0], d: false}, b: true}] f[0].a.c = [42, 43] return f[0] Definition Before a struct data type can be used, it needs to be defined. A struct definition starts with the struct keyword followed by a name. Afterwards, a new-line separated list of variables is declared in curly braces {} . For example: struct Point { field x field y
} Declaration and Initialization Initialization of a variable of a struct type always needs to happen in the same statement as a declaration, unless the struct-typed variable is declared within a function's signature. The following example shows declaration and initialization of a variable of the Point struct type: struct Point { field x field y
} def main() -> (Point): Point p = Point {x: 1, y: 0} return p Assignment The variables within a struct instance, the so called members, can be accessed through the . operator as shown in the following extended example: struct Point { field x field y
} def main(field a) -> (Point): Point p = Point {x: 1, y: 0} p.x = a p.y = p.x return p

